import { Link } from "react-router-dom"
import "./Footer.css"

const Footer = () =>{
    return (
        <div id='FooterOuterContainer'>
            <footer id='footer'>
                <Link className='FooterLine1' id='logo200okFooter' to='/'>200 OK</Link>
                Hello from Footer
            </footer>
        </div>
    )
}

export default Footer
